def scf(lst):
    from math import gcd
    from functools import reduce

    def find_factors(n):
        factors = []
        for i in range(2, n + 1):
            if n % i == 0:
                factors.append(i)
        return factors

    if not lst:
        return 1

    overall_gcd = reduce(gcd, lst)
    factors = find_factors(overall_gcd)

    return factors[0] if factors else 1
