def scf(lst):
    from math import gcd
    from functools import reduce

    def smallest_prime_factor(n):
        if n <= 1:
            return None
        for i in range(2, n + 1):
            if n % i == 0:
                return i
        return None

    overall_gcd = reduce(gcd, lst)
    return smallest_prime_factor(overall_gcd) if overall_gcd > 1 else 1
